INSERT INTO `places` VALUES (1,'Taj Mahal','taj-mahal','Authentic Indian cuisine in the heart of Budapest.',4,4,'<p>Taj Mahal is easy to miss, tucked away just off Terez Korut on Szondi Utca. However, if you venture inside you\'ll find one of the most interesting Indian restaurants in Budapest.&nbsp;</p><p>With an extravagant interior decorated with Indian artwork and fabrics, as well as friendly and professional waiting staff, this is a great spot to try a broad range of Indian cuisine.&nbsp;</p><p>With classic dishes such as Butter Chicken, and Tikka Masala cooked to perfection, this is a great place for people who want a taste of South Asia all the way in Central Europe.&nbsp;</p><p>We strongly recommend their tandoori chicken, served still steaming on a hot plate, and also the Lamb Roganjosh.&nbsp;</p>','Budapest, Szondi u. 40, 1067 Hungary','47.5108025','19.0645201','http://www.tajmahal.hu/','+36 1 301 0447','{\"Mon\":{\"from\":\"-\",\"to\":\"-\"},\"Tue\":{\"from\":\"12:00\",\"to\":\"23:00\"},\"Wed\":{\"from\":\"12:00\",\"to\":\"23:00\"},\"Thu\":{\"from\":\"12:00\",\"to\":\"23:00\"},\"Fri\":{\"from\":\"12:00\",\"to\":\"23:00\"},\"Sat\":{\"from\":\"12:00\",\"to\":\"23:00\"},\"Sun\":{\"from\":\"12:00\",\"to\":\"23:00\"}}','ChIJx_L4vXPcQUcRLtBEHWLq9Ks'),(2,'Funky Pho','funky-pho','Delicious Vietnamese street food joint in District Vi.',5,4,'<p>Funky Pho is a beautiful Vietnamese restaurant hidden behind Andrassy ut on Mozsar utca. With friendly staff, a small, but quirkily decorated interior and some of &nbsp;the tastiest food in Budapest this place is a must visit for anyone interested in authentic South East Asian cuisine.&nbsp;</p><p>It\'s hard to recommend a specific dish here, as everything I\'ve tasted is good, but you can\'t go wrong with traditional Pho.&nbsp;</p><p>Their salads are also delicious, and be sure to top off your meal with some of their home made lemonade.&nbsp;</p>','Budapest, Mozsár u. 7, 1066 Hungary','47.504671','19.0604182','http://www.funkypho.hu/','+36 70 508 0658','{\"Mon\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Tue\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Wed\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Thu\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Fri\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Sat\":{\"from\":\"11:30\",\"to\":\"22:00\"},\"Sun\":{\"from\":\"\",\"to\":\"\"}}',NULL),(3,'Arriba Taqueria','arriba-taqueria','Burritos, Nachos, and cocktails on Terez Korut.',3,3,'<p>Arriba Taquiria is a stylishly decorated, fun Mexican street food restaurant located on the heart of Terez Korut.&nbsp;</p><p>The concept is simple - you choose the meat and filling, and they stuff it into a burrito and serve it with fresh tortilla chips. It\'s simple, filling food, and their pricing is fair given the size of the portions.</p><p>As well as burritos you can grab Ben n Jerry\'s ice cream here, as well as delicious freshly squeed orange juice.&nbsp;</p><p>There\'s a lovely outdoor area, perfect for summer evenings and the interior is stylishly decorated with ample space upstairs for larger groups. Altogether a decent place, and great for simple, tasty and fast food.</p>','Budapest, Teréz krt. 25, 1067 Hungary','47.506594','19.061787','http://www.arriba.hu/','+36 1 374 0057','{\"Mon\":{\"from\":\"11:00\",\"to\":\"22:00\"},\"Tue\":{\"from\":\"11:00\",\"to\":\"22:00\"},\"Wed\":{\"from\":\"11:00\",\"to\":\"22:00\"},\"Thu\":{\"from\":\"11:00\",\"to\":\"2l4:00\"},\"Fri\":{\"from\":\"11:00\",\"to\":\"24:00\"},\"Sat\":{\"from\":\"11:00\",\"to\":\"24:00\"},\"Sun\":{\"from\":\"11:00\",\"to\":\"22:00\"}}',NULL),(4,'Parázs Presszó','parazs-presszo','Tasty Thai food in Downtown Pest.',4,3,'<p>They say you can tell the quality of a restaurant by how busy it is, and&nbsp;Parázs Presszó is usually busy. Popular with locals, and tourists alike, this quirky Thai restaurant is located on Jokai Utca.&nbsp;</p><p>The exterior isn\'t particularly eye catching, but the interior is cost and spacious with comfortable seating and a low key atmosphere.&nbsp;</p><p>The menu is large, with a broad range of classic Thai dishes. The Yom Nuer, which is shredded beef with lemon grass and ginger, comes highly recommended, as does the green curry.&nbsp;</p><p>Portions are large, and service is usually prompt and friendly. They also do takeaway, so well worth a visit for people wanting a taste of South East Asia in the heart of Budapest.&nbsp;</p>','Budapest, Jókai u. 8, 1066 Hungary','47.5062178','19.0603444','http://www.parazspresszo.com/','+36 1 950 3770','{\"Mon\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Tue\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Wed\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Thu\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Fri\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Sat\":{\"from\":\"12:00\",\"to\":\"24:00\"},\"Sun\":{\"from\":\"12:00\",\"to\":\"24:00\"}}',NULL),(5,'Piccolo Café','piccolo-cafe-budapest','Great coffee, sandwiches and service just off Andrassy Ut.',5,5,'<p>I first stumbled across this charming cafe on a hungover Saturday morning, and was instantly impressed by the friendly service, and delicious coffee.&nbsp;</p><p>The service was perfect, the coffee was tasty and the panini with mozzarella, rocket and tomatoes was exactly the type of hearty, tasty food I needed to kick start my day.&nbsp;</p><p>I\'ve since been back 4 or 5 times, and each time I\'ve left happy, thanks to their small, but charming interior, friendly staff and beautiful coffee.&nbsp;</p><p>This is one of my favourite places in Budapest, and if you are nearby I strongly recommend you check it out.&nbsp;</p>','Budapest, Jókai tér 6, 1061 Hungary','47.504872','19.062239','https://facebook.com/PiccoloCafeBudapest/','+36 70 773 2171','{\"Mon\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Tue\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Wed\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Thu\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Fri\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Sat\":{\"from\":\"8:00\",\"to\":\"18:00\"},\"Sun\":{\"from\":\"\",\"to\":\"\"}}',NULL),(6,'Cafe Frei Eiffel tér','cafe-frei','Nice coffee, and fresh pastries next to Nyugati.',4,4,'<p>Cafe Frei has developed a reputation as one of the better coffee chains, and this cafe located on the Eiffel Square development is a great example of why.&nbsp;</p><p>The quirky interior, friendly staff and wide range of coffees makes it a great place to relax with friends over a coffee and cake, and the pricing is also very reasonable.&nbsp;</p><p>Service here is usually friendly and warm, and their cakes and pastries are fresh and tasty.&nbsp;</p><p>I strongly recommend trying this place, and their Earl Grey tea in particular is always impressive.</p>','Budapest, Teréz krt. 55, 1062 Hungary','47.5097441','19.0581589','http://www.cafefrei.hu/',NULL,'{\"Mon\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Tue\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Wed\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Thu\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Fri\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Sat\":{\"from\":\"9:00\",\"to\":\"20:00\"},\"Sun\":{\"from\":\"9:00\",\"to\":\"20:00\"}}',NULL),(7,'CoffeeCat','coffee-cat','Coffee, cakes and juice in District Vi.',4,3,'<p>Located on&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\">Ó utca, in the heart of District Vi, coffee cat is a friendly, stylish cafe with nice coffee, juices and delicious pastries.&nbsp;</span></p><p>The interior is clean and modern, the owner is always happy to chat and the coffee is fresh and tasty. It\'s not cheap, but the quality is high. They also accept Euros, so it\'s definitely friendly to foreign tourists.&nbsp;</p><div><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: 16.12px;\"><br></span></div><div class=\"mod\" data-md=\"1006\" data-ved=\"0ahUKEwibsvzPsPDOAhXISBQKHby_A90QkCkIlAEoAzAU\" style=\"clear: none; padding-left: 15px; padding-right: 15px; line-height: 16.12px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;\"><div class=\"_eFb\"></div></div><p>I recommend their freshly squeezed orange juice, which is always delicious, as well as their coffee. Be sure to check them out if you are ever caffeine deprived in District Vi.&nbsp;</p>','Budapest, Ó u. 44, 1066 Hungary','47.5055179','19.0600002','http://www.coffeecat.hu/index.php','+36 1 708 0170','{\"Mon\":{\"from\":\"7:30\",\"to\":\"16:00\"},\"Tue\":{\"from\":\"7:30\",\"to\":\"16:00\"},\"Wed\":{\"from\":\"7:30\",\"to\":\"16:00\"},\"Thu\":{\"from\":\"7:30\",\"to\":\"16:00\"},\"Fri\":{\"from\":\"7:30\",\"to\":\"16:00\"},\"Sat\":{\"from\":\"9:00\",\"to\":\"13:00\"},\"Sun\":{\"from\":\"\",\"to\":\"\"}}',NULL),(8,'Sudevi Yoga','sudevi-yoga-studio','Beautiful, beginner friendly yoga studio in District Vi.',5,4,'<p>Sudevi yoga is tucked away in the basement floor of an old building on Eotvos Utc in District Vi. The studio runs yoga classes on most weekday afternoons and evenings, mainly focussing on Hatha yoga.&nbsp;</p><p>Having sampled many of Budapest\'s yogic offerings, I have to say this place is by far my favourite. The instruction is always friendly and conscientious, classes are friendly and the atmosphere is tranquil and relaxing.&nbsp;</p><p>I recommend Erno\'s classes on Monday and Wednesdays at 7pm. He\'s a passionate, and hugely knowledgable instructor who has something to teach newbies and experienced yogis alike.&nbsp;</p><p>The pricing is reasonable with a single session at under 2,000 HUF and discounts are available when you buy multiple sessions in advance.&nbsp;</p><p>Namaste.&nbsp;</p>','Budapest, Eötvös u. 19, 1067 Hungary','47.5065157','19.0639569','http://sudevijoga.hu/','+36 70 3699774','{\"Mon\":\"15:00 - 22:00\",\"Tue\":\"15:00 - 22:00\",\"Wed\":\"15:00 - 22:00\",\"Thu\":\"15:00 - 22:00\",\"Fri\":\"15:00 - 22:00\",\"Sat\":\"15:00 - 22:00\",\"Sun\":\"15:00 - 22:00\"}',NULL),(9,'Westfit Gym','westfit-gym','Spacious well equipped gym on Jokai Utca',3,3,'<p>Westfit gym, on Jokai Utca is a spacious, well equipped gym that caters to most peoples\' workout needs. I first went around 2 months ago and was pleasantly surprised by the range of equipment, laid back atmosphere and pricing.&nbsp;</p><p>Upstarts boasts a large free weights area with dumbbells, squat racks and a range of machines, whilst the downstairs hosts cardio equipment including treadmills and running machines.</p><p>There is a studio downstairs for classes, and protein shakes, water and other gym related supplements are available for purchase at the reception desk.&nbsp;</p><p>It can get slightly busy in the evening, but compared to other places it\'s a very relaxed gym, and especially empty on Sundays. Well worth joining for gym junkies located near District Vi.&nbsp;</p>','Budapest, Jókai u. 15, 1066 Hungary','47.507305','19.0594079','http://www.westfitgym.hu/','+36 20 256 9350','{\"Mon\":{\"from\":\"6:00\",\"to\":\"22:00\"},\"Tue\":{\"from\":\"6:00\",\"to\":\"22:00\"},\"Wed\":{\"from\":\"6:00\",\"to\":\"22:00\"},\"Thu\":{\"from\":\"6:00\",\"to\":\"22:00\"},\"Fri\":{\"from\":\"6:00\",\"to\":\"22:00\"},\"Sat\":{\"from\":\"8:00\",\"to\":\"20:00\"},\"Sun\":{\"from\":\"8:00\",\"to\":\"20:00\"}}',NULL),(10,'Bliss and Body','bliss-fitness','High end gym and wellness centre in District Vi.',3,3,'<p>Bliss fitness is a health club located on the ground floor of a hotel on O Utca. Whilst the gym itself isn\'t huge, there is a spacious, and modern wellness area with a heated indoor pool, jacuzzi, sauna and steam room.&nbsp;</p><p>The gym itself has a small free weights area, cardio machines and studio area at the back. Staff are friendly and the atmosphere is pleasant.&nbsp;</p><p>Long term memberships are available for around 20,000 HUF monthly, and day passes go for just over 2,000 HUF.&nbsp;</p><p>Personal training is also available at a reasonable price. It\'s a good gym for people who want access to a pool and wellness facilities and is only a short walk from Oktogon and Terez Korut.&nbsp;</p>','Budapest, Ó u. 49, 1066 Hungary','47.5054189','19.0601417','http://blissandbody.hu/','+36 1 269 0668','{\"Mon\":{\"from\":\"6.30\",\"to\":\"22:00\"},\"Tue\":{\"from\":\"6.30\",\"to\":\"22:00\"},\"Wed\":{\"from\":\"6.30\",\"to\":\"22:00\"},\"Thu\":{\"from\":\"6.30\",\"to\":\"22:00\"},\"Fri\":{\"from\":\"6.30\",\"to\":\"22:00\"},\"Sat\":{\"from\":\"8:00\",\"to\":\"20:00\"},\"Sun\":{\"from\":\"8:00\",\"to\":\"20:00\"}}',NULL),(11,'Művész Mozi','muvesz-mozi','Quirky arthouse cinema on Terez Korut.',5,5,'Művész Mozi is a beautiful, quirky arthouse cinema on Terez Korut in District Vi.&nbsp;With a great range of films showing, from modern movies to classic films it\'s one of the best places to catch great films in Budapest. Prices are reasonably and the atmosphere inside is relaxed and fun.<p>As well as the cinema there is a bespoke jewellers selling some beautiful necklaces and rings, as well as a bar where you can grab a cold beer before the film starts.&nbsp;</p><p>To top it off, you can also rent from an encyclopedic range of films available on DVD at the back of the premises. So whether you want to rent, view, drink or just buy a new necklace we highly recommend checking this place out.&nbsp;</p>','Budapest, Teréz krt. 30, 1066 Hungary','47.5065963','19.0611456','http://muveszmozi.hu/','+36 1 459 5050',NULL,NULL),(12,'BITE bakery café','bite-bakery-cafe','Freshly baked food, and coffee in District Vi.',4,4,'<p>Located opposite Nyugati Ter, Bite Bakery Cafe is a small, friendly cafe that offers some interesting food and fresh coffee.&nbsp;</p><p>Their breakfast menu is great, and their tasty and cheap pretzels are a great way to start your day.&nbsp;</p><p>One thing that always stands out to me is how friendly and helpful the staff are here. There\'s plenty of room to relax and chat with friends and the location makes it a great place to go when you are exploring down town Pest.&nbsp;</p><p><br></p>','Budapest, Teréz krt. 62, 1066 Hungary','47.5097474','19.05676','http://www.bitebakerycafe.hu/','+36 30 690 2185','{\"Mon\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Tue\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Wed\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Thu\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Fri\":{\"from\":\"7:00\",\"to\":\"20:00\"},\"Sat\":{\"from\":\"8:00\",\"to\":\"19:00\"},\"Sun\":{\"from\":\"8:00\",\"to\":\"19:00\"}}',NULL),(13,'Slow Foodiez','slow-foodiez','Beautiful vegetarian and vegan food on Szondi Utca.',5,4,'<p>Even if you aren\'t vegetarian, or vegan, I highly recommend sampling the culinary delights at Slow Foodies. The food is fresh, and delicious, the staff are friendly and the restaurant is comfortable.&nbsp;</p><p>The menu is updated regularly so it\'s hard to recommend a specific dish, but I\'ve always enjoyed their salad bowls, green smoothies and delicious deserts.&nbsp;</p><p>In summer you can order fresh lemonade, and in colder months you can have great coffee or tea with your meal.&nbsp;</p><p>This place is one of our favourite places in the whole of BP so make sure you check it out if your in the area.&nbsp;</p>','Budapest, Szondi u. 11, 1067 Hungary','47.508487','19.060605','http://www.slowfoodiez.hu/','+36 30 444 1983','{\"Mon\":{\"from\":\"\",\"to\":\"\"},\"Tue\":{\"from\":\"10:00\",\"to\":\"18:00\"},\"Wed\":{\"from\":\"10:00\",\"to\":\"18:00\"},\"Thu\":{\"from\":\"10:00\",\"to\":\"18:00\"},\"Fri\":{\"from\":\"10:00\",\"to\":\"18:00\"},\"Sat\":{\"from\":\"10:00\",\"to\":\"18:00\"},\"Sun\":{\"from\":\"10:00\",\"to\":\"18:00\"}}',NULL),(14,'Downdog Yoga','downdog-yoga','Friendly Yoga studio on Eotvos Utca.',3,3,'<p>If you are into yoga, downdog is definitely worth checking out. It\'s a clean spacious studio just off Terez Korut with a wide range of yoga classes including Hatha and Hatha Flow.&nbsp;</p><p>There are beginner as well as more advanced level classes available and the instructors are friendly and happy to help.&nbsp;</p><p>If you are after an English speaking class you can find more information on their website timetable, but I\'ve managed to do well even when the instructor doesn\'t speak Angolul.&nbsp;</p><p><br></p>','Budapest, Eötvös u. 26/c, 1067 Hungary','47.5071659','19.0625096',NULL,NULL,'{\"Mon\":{\"from\":\"\",\"to\":\"\"},\"Tue\":{\"from\":\"\",\"to\":\"\"},\"Wed\":{\"from\":\"\",\"to\":\"\"},\"Thu\":{\"from\":\"\",\"to\":\"\"},\"Fri\":{\"from\":\"\",\"to\":\"\"},\"Sat\":{\"from\":\"\",\"to\":\"\"},\"Sun\":{\"from\":\"\",\"to\":\"\"}}',NULL),(15,'Ankert','ankert','Cool \"kert\" to hangout and it\'s right next to the center',4,3,'<p>There\'s a big opened hall and even bigger indoor territory, so I can easily go there at night, during winter time, but of course I\'ll enjoy it the most on summer nights. Comparing with hungarian prices, place can seem expensive, but just a bit, so for a beer you\'ll probably pay only 150ft more than average price. They usually do parties, but you can never guess when, unless you follow their news(fb).&nbsp;<br></p>','Budapest, Paulay Ede u. 33, 1061 Hungary','47.5013408','19.0590815','http://ankerklub.hu/','+36 30 360 3389','{\"Mon\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Tue\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Wed\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Thu\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Fri\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Sat\":{\"from\":\"16:00\",\"to\":\"2:00\"},\"Sun\":{\"from\":\"16:00\",\"to\":\"2:00\"}}','ChIJeUfBw2vcQUcRsBNLJjNNazA'),(16,'SHOT Cafe & Bar','shot-cafe-bar','Cheap and cool place to have a bit of a party',3,5,'<p>Been there only once, didn\'t really like the interior but it\'s so minor, especially on Friday night. They usually have some cool DJ\'s there to play cool music as well. Things I really liked about the place are prices and the crowd. Lots of fun.</p><p>They also have a terrace and they\'re opened during daytime, so you easily hop in for a coffee, but don\'t expect it to be too good.</p>','Budapest, Erzsébet krt. 35, 1073 Hungary','47.5014805','19.0679817','https://www.facebook.com/shotbarbp','+36 30 846 6886','[]','ChIJz5ly_2XcQUcR77MG8cs3n_s'),(17,'Akademia Italia','akademia-italia-budapest','One of the best coffees you\'ll find in Budapest',5,5,'<p>They have exclusively tasty coffee and so are their meals. Wooden interior and weird layout inside creates the feeling that place is huge and chic, and it\'s true. Whether you\'ll stop by for a cup of coffee on Sunday morning or you want to make a romantic date for your beloved one, you can\'t go wrong with this place. Beautiful view on St. Stephen\'s basilica adds its charm to the time spent there.&nbsp;</p><p>As for me, prices here are low. Normally in Budapest you\'ll pay alot more than they ask for the quality they provide. So for a cup of coffee here you\'ll pay 500ft which is expensive, but go around the city center and find better coffee than that, for less money and I\'ll by you a coffee there myself.</p><p>As the name says, they specialise on italian cuisine. Their chefs can even teach you how to cook as good as them, for a special price of course and probably you won\'t get all of their secrets, cause their food is gooooood. You can apply for food courses, which you can find on their website. Everyday they can train you to cook something delicious.</p>','Budapest, Szent István tér 12, 1051 Hungary','47.5013907','19.0533423','http://www.akademiaitalia.hu/','+36 1 301 0563','{\"Mon\":{\"from\":\"7:30\",\"to\":\"23:30\"},\"Tue\":{\"from\":\"7:30\",\"to\":\"23:30\"},\"Wed\":{\"from\":\"7:30\",\"to\":\"23:30\"},\"Thu\":{\"from\":\"7:30\",\"to\":\"23:00\"},\"Fri\":{\"from\":\"7:30\",\"to\":\"23:00\"},\"Sat\":{\"from\":\"7:30\",\"to\":\"23:00\"},\"Sun\":{\"from\":\"7:30\",\"to\":\"23:30\"}}',NULL),(18,'Ötkert','otkert','Exclusive ruin bar/restaurant in the heart of BP',5,2,'<p>This is a cool place to hangout, so if you wan\'t to spend your weekend partying you should definitely stop there at some point. It can be a bit pricey, comparing to other places of course, but it\'s definitely worth it. They serve meals there as well during daytime, so it can count as restaurant as well and the thing that it\'s right in the heart of the city makes this place exclusive, in fact it\'s only 400 meters from St. Stephen\'s basilica &nbsp;towards the river.</p>','Budapest, Zrínyi u. 4, 1051 Hungary','47.500393','19.048381','http://www.otkert.hu/','+36 70 330 8652','{\"Mon\":{\"from\":\"11:00\",\"to\":\"00:00\"},\"Tue\":{\"from\":\"11:00\",\"to\":\"00:00\"},\"Wed\":{\"from\":\"11:00\",\"to\":\"00:00\"},\"Thu\":{\"from\":\"11:00\",\"to\":\"05:00\"},\"Fri\":{\"from\":\"11:00\",\"to\":\"05:00\"},\"Sat\":{\"from\":\"11:00\",\"to\":\"05:00\"},\"Sun\":{\"from\":\"11:00\",\"to\":\"00:00\"}}','ChIJsZI4nRXcQUcRR-YYBZCskAk'),(19,'Hauzol Cafe','hauzol-cafe','Good and cheap bar on one of the main streets',3,4,'<p>A simple pub with a front bar, table football and cheap drinks. They even organise special events there such as Halloween parties or football championships - usually they use facebook to spread a word about it but you can find it all here as well.</p><p>Oh, and the fact that this place works non-stop makes this place quite useful sometimes ;)</p>','Budapest, 1073, Erzsébet krt. 26, 1073 Hungary','47.499969','19.068743','https://www.facebook.com/hauzol/','+36 30 653 2965','{\"Mon\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Tue\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Wed\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Thu\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Fri\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Sat\":{\"from\":\"00:00\",\"to\":\"24:00\"},\"Sun\":{\"from\":\"00:00\",\"to\":\"24:00\"}}','ChIJqwC3ambcQUcROlAp2tiMUG8'),(20,'Noiret','noiret','Cool billiard/darts hall with true atmosphere',4,5,'<p>One of the best poolhalls in Budapest, to my opinion. They have lots of tables, so you\'ll definitely find yourself one whether it will be classic pool or snooker, in fact they have quite easy table-booking on their website - that\'s what I usually use. You can also buy professional pool queues and darts from them.</p><p> Beer is good, other drinks as well, regular bar set of drinks, though sometimes they have discounts for drink sets. I quite like the atmosphere there, true pub for real man. You should definitely go there for a drink!</p>','Budapest, Dessewffy u. 8, 1066 Hungary','47.5047714','19.0563336','http://www.noiret.hu/','+36 1 331 6103','{\"Mon\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Tue\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Wed\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Thu\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Fri\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Sat\":{\"from\":\"10:00\",\"to\":\"04:00\"},\"Sun\":{\"from\":\"10:00\",\"to\":\"04:00\"}}','ChIJtU2Yt2zcQUcRSauLf1HLlZw'),(21,'Corso Gourmet','corso-gourmet','Perfect place to get a lunch for a good price',3,5,'<p>Menus for 1000ft, don\'t hesitate if you\'re hungry - choice is quite good for the price, you\'ll get a soup and a main dish. Additionally you can select one of 3-4 types of salads they have.</p><p>Main thing about this place is it\'s ....</p>','Budapest, Váci u. 54, 1056 Hungary','47.490148','19.055388','http://www.corsogourmet.hu/','+36 30 428 8376','{\"Mon\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Tue\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Wed\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Thu\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Fri\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Sat\":{\"from\":\"08:00\",\"to\":\"21:00\"},\"Sun\":{\"from\":\"08:00\",\"to\":\"21:00\"}}','ChIJf18CsEXcQUcR7P2YQ0Xs-iA');
